import React from "react";

import Header from "./Homepage/header";
import Content from "./Homepage/bodyContent";
import NoMatch from "./Nomatch";
import VideoPage from "./vedioPage";

import {
  BrowserRouter as Router,
  Switch,
  Redirect,
  Route,
  useHistory
} from "react-router-dom";
function App() {
    const history=useHistory()
    window.onpopstate=()=>{
        console.log("CALED OnPOP");
        if(history.location.hash==='#init'){
            history.push("/")
        }

    }
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <div className="homepage">
            <Header />
            <Content />
          </div>
        </Route>
        <Route exact path="/:id">
          <VideoPage />
        </Route>
        <Route path="*">
          <div className="homepage">
            <NoMatch />
          </div>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
